import React, { useState, useEffect } from 'react';
import './WorkspaceColumn.css';

const WorkspaceColumn = ({ selectedFile, fileContent }) => {
  const [selectedTab, setSelectedTab] = useState('view');
  const [content, setContent] = useState('');
  const [tableData, setTableData] = useState({
    headers: [],
    rows: []
  });
  const [originalTableData, setOriginalTableData] = useState(null);

  useEffect(() => {
    // Reset content when file changes
    if (selectedFile) {
      if (selectedFile.type === 'xlsx_header') {
        // Handle XLSX header selection
        const { sheetData, headerIndex } = selectedFile;

        // Extract the column data for this header
        const headerName = sheetData.headers[headerIndex];
        const columnData = sheetData.rows.map(row => row[headerIndex]);

        // Set the table data for display
        const newTableData = {
          headers: [headerName],
          rows: columnData.map(value => [value])
        };

        setTableData(newTableData);
        setOriginalTableData({...newTableData});

        // Switch to view tab
        setSelectedTab('view');

        // Set content to empty to use table view instead
        setContent('');
      } else if (selectedFile.type === 'file') {
        // Regular file selected, show file info
        setContent(JSON.stringify({
          fileName: selectedFile.name,
          path: selectedFile.path,
          type: selectedFile.type
        }, null, 2));

        // Clear table data
        setTableData({
          headers: [],
          rows: []
        });
        setOriginalTableData(null);
      } else if (selectedFile.type === 'xlsx_sheet') {
        // Sheet selected, show all data from the sheet
        const { sheetData } = selectedFile;

        const newTableData = {
          headers: sheetData.headers,
          rows: sheetData.rows
        };

        setTableData(newTableData);
        setOriginalTableData({...newTableData});

        // Switch to view tab
        setSelectedTab('view');

        // Set content to empty to use table view instead
        setContent('');
      }
    } else {
      // No file selected
      setContent(JSON.stringify({
        message: "No file selected",
        instruction: "Select a file or header from the file explorer"
      }, null, 2));

      // Clear table data
      setTableData({
        headers: [],
        rows: []
      });
      setOriginalTableData(null);
    }
  }, [selectedFile]);

  const handleTabChange = (tab) => {
    setSelectedTab(tab);
  };

  // ë¶„ë¦¬ë¶„ë¥˜ ê¸°ëŠ¥ ì²˜ë¦¬ í•¨ìˆ˜
  const handleSeparationMagic = () => {
    if (!tableData.headers.length || !tableData.rows.length) return;

    // ì›ë³¸ ë°ì´í„°ê°€ ìˆëŠ” ê²½ìš° í™œìš© (ë¦¬ì…‹ ê°€ëŠ¥í•˜ë„ë¡)
    const dataToProcess = originalTableData ? [...originalTableData.rows] : [...tableData.rows];

    // ì¤‘ë³µ ì œê±°ë¥¼ ìœ„í•œ Set ê°ì²´ë“¤
    const bracketSet = new Set();
    const valueSet = new Set();

    // ê° í–‰ ì²˜ë¦¬
    dataToProcess.forEach(row => {
      const cellValue = row[0];

      // null, undefined, ë¹ˆ ë¬¸ìì—´ ë“± ê±´ë„ˆë›°ê¸°
      if (cellValue === null || cellValue === undefined || String(cellValue).trim() === '') {
        return;
      }

      const cellValueStr = String(cellValue);

      // 1. ê´„í˜¸ ë‚´ìš© ì²˜ë¦¬ - ë‹¤ì–‘í•œ ê´„í˜¸ ìœ í˜• ì²˜ë¦¬ (ì†Œê´„í˜¸, ëŒ€ê´„í˜¸, ì¤‘ê´„í˜¸)
      const bracketContentRegex = /\(([^)]*)\)|\[([^\]]*)\]|\{([^}]*)\}/g;
      let textWithoutBrackets = cellValueStr.replace(bracketContentRegex, (match, p1, p2, p3) => {
        const content = p1 || p2 || p3; // ê´„í˜¸ ì¢…ë¥˜ì— ë”°ë¼ p1, p2, p3 ì¤‘ í•˜ë‚˜ì— ê°’ì´ ìˆìŒ
        if (content && content.trim()) {
          // ì¤‘ë³µ ì œê±°ë¥¼ ìœ„í•´ Setì— ì¶”ê°€
          bracketSet.add(content.trim());
        }
        return ' '; // ê´„í˜¸ì™€ ë‚´ìš©ì„ ê³µë°±ìœ¼ë¡œ ëŒ€ì²´
      });

      // 2. ê³µë°±ê³¼ ì‰¼í‘œë¡œ ë¶„ë¦¬
      const separatedValues = textWithoutBrackets
        .split(/[\s,]+/) // ê³µë°±ê³¼ ì‰¼í‘œë¡œ ë¶„ë¦¬
        .map(value => value.trim())
        .filter(value => value.length > 0); // ë¹ˆ ë¬¸ìì—´ ì œê±°

      // ì¤‘ë³µ ì œê±°ë¥¼ ìœ„í•´ Setì— ì¶”ê°€
      separatedValues.forEach(value => {
        if (value && value.trim()) {
          valueSet.add(value.trim());
        }
      });
    });

    // ê²°ê³¼ ê°’ ë°°ì—´ ìƒì„± (ì¤‘ë³µ ì œê±°ëœ ê°’ë“¤)
    let bracketValues = Array.from(bracketSet).map(val => `[ê´„í˜¸] ${val}`);
    let normalValues = Array.from(valueSet);

    // ê²°ê³¼ê°€ ì—†ìœ¼ë©´ "ë¶„ë¦¬ëœ ê°’ì´ ì—†ìŠµë‹ˆë‹¤" í‘œì‹œ
    if (bracketValues.length === 0 && normalValues.length === 0) {
      setTableData({
        headers: ["Group", "Token"],
        rows: [["", "ë¶„ë¦¬ëœ ê°’ì´ ì—†ìŠµë‹ˆë‹¤"]]
      });
      return;
    }

    // ë¬¸ìì—´ ë’¤ì§‘ê¸° í•¨ìˆ˜
    const reverseString = str => str.split('').reverse().join('');

    // ëª¨ë“  ìµœì†Œ í† í° ë°°ì—´
    const allMinTokens = [...bracketValues, ...normalValues];

    // 3. ë¶€ë¶„ë¬¸ìì—´ ê¸°ë°˜ ì•„ì´í…œì…‹ ë§ˆì´ë‹ (ê³µí†µ ë¶€ë¶„ ë¬¸ìì—´ ì¶”ì¶œ)
    // ìì£¼ ë“±ì¥í•˜ëŠ” ë¶€ë¶„ ë¬¸ìì—´ ì°¾ê¸° - ë°©í–¥ì„± ì¶”ê°€ (ì•, ë’¤)
    const findCommonSubstrings = (tokens, minLength = 1, minCount = 2, direction = 'any') => {
      // ë¶€ë¶„ ë¬¸ìì—´ ë¹ˆë„ ì¹´ìš´íŠ¸
      const substringFreq = {};

      // ëª¨ë“  ê°€ëŠ¥í•œ ë¶€ë¶„ ë¬¸ìì—´ ì¶”ì¶œ ë° ì¹´ìš´íŠ¸
      tokens.forEach(token => {
        // ê´„í˜¸ íƒœê·¸ ì œê±°
        const cleanToken = token.replace('[ê´„í˜¸] ', '');

        // ì•ì—ì„œë¶€í„° ì‹œì‘í•˜ëŠ” ë¶€ë¶„ ë¬¸ìì—´ (ì ‘ë‘ì‚¬)
        if (direction === 'prefix' || direction === 'any') {
          for (let len = minLength; len <= cleanToken.length; len++) {
            const substr = cleanToken.substring(0, len);
            if (substr.length >= minLength) {
              if (!substringFreq[substr]) {
                substringFreq[substr] = { 
                  count: 1, 
                  tokens: [token],
                  direction: 'prefix'
                };
              } else if (!substringFreq[substr].tokens.includes(token)) {
                substringFreq[substr].count++;
                substringFreq[substr].tokens.push(token);
                // ë°©í–¥ ì •ë³´ ì—…ë°ì´íŠ¸ (ì ‘ë‘ì‚¬ë¡œë„ ì‚¬ìš©ë¨)
                if (substringFreq[substr].direction !== 'prefix') {
                  substringFreq[substr].direction = 'both';
                }
              }
            }
          }
        }

        // ë’¤ì—ì„œë¶€í„° ì‹œì‘í•˜ëŠ” ë¶€ë¶„ ë¬¸ìì—´ (ì ‘ë¯¸ì‚¬)
        if (direction === 'suffix' || direction === 'any') {
          for (let len = minLength; len <= cleanToken.length; len++) {
            const substr = cleanToken.substring(cleanToken.length - len);
            if (substr.length >= minLength) {
              if (!substringFreq[substr]) {
                substringFreq[substr] = { 
                  count: 1, 
                  tokens: [token],
                  direction: 'suffix'
                };
              } else if (!substringFreq[substr].tokens.includes(token)) {
                substringFreq[substr].count++;
                substringFreq[substr].tokens.push(token);
                // ë°©í–¥ ì •ë³´ ì—…ë°ì´íŠ¸ (ì ‘ë¯¸ì‚¬ë¡œë„ ì‚¬ìš©ë¨)
                if (substringFreq[substr].direction !== 'suffix') {
                  substringFreq[substr].direction = 'both';
                }
              }
            }
          }
        }

        // ì¼ë°˜ ë¶€ë¶„ ë¬¸ìì—´ (ì¤‘ê°„ì— ìˆëŠ” ê²ƒë„ í¬í•¨)
        if (direction === 'any') {
          for (let len = minLength; len <= cleanToken.length; len++) {
            for (let i = 1; i < cleanToken.length - len; i++) {
              const substr = cleanToken.substring(i, i + len);
              if (substr.length >= minLength) {
                if (!substringFreq[substr]) {
                  substringFreq[substr] = { 
                    count: 1, 
                    tokens: [token],
                    direction: 'middle'
                  };
                } else if (!substringFreq[substr].tokens.includes(token)) {
                  substringFreq[substr].count++;
                  substringFreq[substr].tokens.push(token);
                  // ì´ë¯¸ ë‹¤ë¥¸ ë°©í–¥ì´ ìˆìœ¼ë©´ 'mixed'ë¡œ í‘œì‹œ
                  substringFreq[substr].direction = 'mixed';
                }
              }
            }
          }
        }
      });

      // ë¹ˆë„ì— ë”°ë¼ í•„í„°ë§ ë° ì •ë ¬
      const commonSubstrings = Object.entries(substringFreq)
        .filter(([substr, data]) => {
          // ê¸°ë³¸ í•„í„°: ìµœì†Œ ê°œìˆ˜ ì´ìƒ
          const baseFilter = data.count >= minCount;

          // í•œê¸€ìì¸ ê²½ìš° íŠ¹ë³„ ì²˜ë¦¬: ë” ë†’ì€ ë¹ˆë„ ìš”êµ¬
          if (substr.length === 1) {
            // í•œê¸€ìëŠ” 30%ì´ìƒ ì»¤ë²„í•´ì•¼ í•¨
            const coverage = (data.tokens.length / tokens.length) * 100;
            return baseFilter && (coverage >= 30 || data.count >= 5);
          }

          return baseFilter;
        })
        .sort((a, b) => {
          // 1. í† í° ìˆ˜ ë‚´ë¦¼ì°¨ìˆœ
          const countDiff = b[1].count - a[1].count;
          if (countDiff !== 0) return countDiff;

          // 2. ê¸¸ì´ ë‚´ë¦¼ì°¨ìˆœ
          const lengthDiff = b[0].length - a[0].length;
          if (lengthDiff !== 0) return lengthDiff;

          // 3. ì•ŒíŒŒë²³ ìˆœì„œ
          return a[0].localeCompare(b[0]);
        })
        .map(([substr, data]) => ({
          substring: substr,
          count: data.count,
          tokens: data.tokens,
          direction: data.direction,
          percentCoverage: (data.tokens.length / tokens.length) * 100
        }));

      return commonSubstrings;
    };

    // ë³µí•©ì–´ ê´€ê³„ ë¶„ì„ í•¨ìˆ˜
    const analyzeCompoundRelationships = (tokens) => {
      const relationships = [];

      // ëª¨ë“  í† í° ìŒì— ëŒ€í•´ ê²€ì‚¬
      for (let i = 0; i < tokens.length; i++) {
        const token1 = tokens[i].replace('[ê´„í˜¸] ', '');

        for (let j = 0; j < tokens.length; j++) {
          if (i === j) continue;

          const token2 = tokens[j].replace('[ê´„í˜¸] ', '');

          // ë³µí•©ì–´ ê´€ê³„ í™•ì¸: token1ì´ token2ì˜ ì¼ë¶€ì¸ì§€
          if (token2.includes(token1)) {
            // ë‹¨ìˆœ í¬í•¨ì´ ì•„ë‹Œ, ê²½ê³„ì— ìˆëŠ”ì§€ í™•ì¸ (ë‹¨ì–´ ê²½ê³„)
            const position = token2.indexOf(token1);
            const beforeChar = position > 0 ? token2[position - 1] : '';
            const afterChar = position + token1.length < token2.length ? token2[position + token1.length] : '';

            // ë‹¨ì–´ ê²½ê³„(ë„ì–´ì“°ê¸°ë‚˜ ë¬¸ìì—´ ì‹œì‘/ë)ì— ìˆëŠ” ê²½ìš°ë§Œ ë³µí•©ì–´ë¡œ ê°„ì£¼
            const isWordBoundary = (position === 0 || beforeChar === ' ' || beforeChar === '-') &&
                                  (position + token1.length === token2.length || afterChar === ' ' || afterChar === '-');

            if (isWordBoundary || token1.length >= 2) {
              relationships.push({
                parent: tokens[j],   // ë³µí•©ì–´
                child: tokens[i],    // ë¶€ë¶„ì–´
                position: position   // ìœ„ì¹˜
              });
            }
          }
        }
      }

      return relationships;
    };

    // ë³µí•©ì–´ ê´€ê³„ ë¶„ì„
    const compoundRelationships = analyzeCompoundRelationships(allMinTokens);

    // ë°©í–¥ë³„ ë¶€ë¶„ ë¬¸ìì—´ ì¶”ì¶œ
    const prefixSubstrings = findCommonSubstrings(allMinTokens, 1, 2, 'prefix');
    const suffixSubstrings = findCommonSubstrings(allMinTokens, 1, 2, 'suffix');

    // ì¤‘ë³µ ì œê±°ì™€ ì»¤ë²„ë¦¬ì§€ ìµœì í™”ë¥¼ ìœ„í•œ ê·¸ë¦¬ë”” ì•Œê³ ë¦¬ì¦˜ - ë°©í–¥ì„± ê³ ë ¤ ì¶”ê°€
    const selectOptimalSubstrings = (substrings, tokens, compoundRel, maxGroups = 10) => {
      // ì»¤ë²„ë¦¬ì§€ê°€ ì¢‹ì€ ìˆœì„œë¡œ ì •ë ¬ (ì ìˆ˜ ê³„ì‚° ê°œì„ )
      const sortedSubstrings = [...substrings]
        .sort((a, b) => {
          // ë³µí•©ì–´ ê´€ê³„ê°€ ìˆëŠ” ì„œë¸ŒìŠ¤íŠ¸ë§ì— ê°€ì¤‘ì¹˜ ë¶€ì—¬
          const hasCompoundA = compoundRel.some(rel => 
            rel.parent.includes(a.substring) || rel.child.includes(a.substring));
          const hasCompoundB = compoundRel.some(rel => 
            rel.parent.includes(b.substring) || rel.child.includes(b.substring));

          if (hasCompoundA && !hasCompoundB) return -1;
          if (!hasCompoundA && hasCompoundB) return 1;

          // í† í°ìˆ˜ * ê¸¸ì´^2ë¡œ ì ìˆ˜ ê³„ì‚° (ë” ë§ì€ í† í°ì„ ì»¤ë²„í•˜ê³  ë” ê¸´ ë¶€ë¶„ë¬¸ìì—´ ìš°ì„ )
          // ê¸¸ì´ì— ì œê³±ì„ í•˜ì—¬ ë” ê¸´ ë¶€ë¶„ë¬¸ìì—´ì„ ê°•ë ¥íˆ ì„ í˜¸
          const scoreA = a.count * Math.pow(a.substring.length, 2);
          const scoreB = b.count * Math.pow(b.substring.length, 2);
          return scoreB - scoreA;
        });

      const selectedSubstrings = [];
      const coveredTokens = new Set();

      // ê·¸ë¦¬ë”” ì„ íƒ (ê°œì„ )
      for (const substr of sortedSubstrings) {
        // ìƒˆë¡œìš´ í† í°ì„ ì»¤ë²„í•˜ëŠ”ì§€ í™•ì¸
        const newCoverage = substr.tokens.some(token => !coveredTokens.has(token));

        // ì„ íƒ ì¡°ê±´ ê°œì„ :
        // 1. ìƒˆ í† í°ì„ ì»¤ë²„í•˜ê±°ë‚˜
        // 2. ì¤‘ìš” ì„œë¸ŒìŠ¤íŠ¸ë§(2ê¸€ì ì´ìƒ & 3ê°œ ì´ìƒì˜ í† í°) ë˜ëŠ”
        // 3. ë†’ì€ ì§€ì§€ë„ë¥¼ ê°€ì§„ í•œê¸€ì (í•œê¸€ìì§€ë§Œ ì¤‘ìš”í•œ ì˜ë¯¸ë¥¼ ê°€ì§ˆ ìˆ˜ ìˆìŒ)
        const isImportantSubstr = substr.substring.length >= 2 && substr.count >= 3;
        const isHighSupportSingleChar = substr.substring.length === 1 && substr.count >= Math.max(4, tokens.length * 0.2);

        if (newCoverage || isImportantSubstr || isHighSupportSingleChar) {
          selectedSubstrings.push(substr);

          // ì»¤ë²„ëœ í† í° ì—…ë°ì´íŠ¸
          substr.tokens.forEach(token => coveredTokens.add(token));
        }

        // ë°©í–¥ë³„ë¡œ ìµœëŒ€ ê·¸ë£¹ ìˆ˜ ì œí•œ
        if (selectedSubstrings.length >= maxGroups) break;
      }

      return selectedSubstrings;
    };

    // ìµœì ì˜ ë¶€ë¶„ ë¬¸ìì—´ ì„ íƒ (ë°©í–¥ë³„)
    const optimalPrefixSubstrings = selectOptimalSubstrings(prefixSubstrings, allMinTokens, compoundRelationships, 8);
    const optimalSuffixSubstrings = selectOptimalSubstrings(suffixSubstrings, allMinTokens, compoundRelationships, 8);

    // ë³µí•©ì–´ ê´€ê³„ë§Œìœ¼ë¡œ ê·¸ë£¹ í˜•ì„±
    const formCompoundGroups = (relationships, tokens) => {
      // ë³µí•©ì–´ë¥¼ í‚¤ë¡œ í•˜ëŠ” ê·¸ë£¹ ë§µ ìƒì„±
      const compoundGroups = {};

      relationships.forEach(rel => {
        const parentToken = rel.parent;
        if (!compoundGroups[parentToken]) {
          compoundGroups[parentToken] = {
            parent: parentToken,
            children: [rel.child],
            positions: [rel.position]
          };
        } else if (!compoundGroups[parentToken].children.includes(rel.child)) {
          compoundGroups[parentToken].children.push(rel.child);
          compoundGroups[parentToken].positions.push(rel.position);
        }
      });

      // ìì‹ì´ ë§ì€ ìˆœìœ¼ë¡œ ì •ë ¬
      const sortedGroups = Object.values(compoundGroups)
        .sort((a, b) => b.children.length - a.children.length)
        .filter(group => group.children.length >= 2); // ìµœì†Œ 2ê°œ ì´ìƒì˜ ìì‹ì„ ê°€ì§„ ê·¸ë£¹ë§Œ

      return sortedGroups.slice(0, 5); // ìƒìœ„ 5ê°œ ê·¸ë£¹ë§Œ ì„ íƒ
    };

    // ë³µí•©ì–´ ê·¸ë£¹ í˜•ì„±
    const compoundGroups = formCompoundGroups(compoundRelationships, allMinTokens);

    // í…Œì´ë¸” í–‰ êµ¬ì„±
    const finalRows = [];

    // 1. ì ‘ë‘ì‚¬(ì•ê¸€ì) ê·¸ë£¹ í—¤ë” ì¶”ê°€
    finalRows.push([
      "ğŸŒ² ì ‘ë‘ì‚¬ ê¸°ì¤€ ê·¸ë£¹ (ì•ê¸€ììˆœ)", 
      ""
    ]);

    // ì ‘ë‘ì‚¬ ê¸°ì¤€ ê·¸ë£¹ ì¶”ê°€
    optimalPrefixSubstrings.forEach(group => {
      finalRows.push([
        `ğŸ“Œ ì•ë¶€ë¶„: ${group.substring} (${group.count})`, 
        ""
      ]);

      // ì´ ê·¸ë£¹ì— ì†í•œ ëª¨ë“  í† í° ì¶”ê°€
      const groupTokens = group.tokens.sort((a, b) => {
        // ê´„í˜¸ ì½˜í…ì¸  ë¨¼ì €, ê·¸ ë‹¤ìŒ ì•ŒíŒŒë²³ ìˆœ
        const aIsBracket = a.startsWith('[ê´„í˜¸]');
        const bIsBracket = b.startsWith('[ê´„í˜¸]');

        if (aIsBracket && !bIsBracket) return -1;
        if (!aIsBracket && bIsBracket) return 1;

        return a.localeCompare(b);
      });

      groupTokens.forEach(token => {
        finalRows.push(["â””â”€", token]);
      });

      // ê·¸ë£¹ ê°„ êµ¬ë¶„ì„ ìœ„í•œ ë¹ˆ í–‰
      finalRows.push(["", ""]);
    });

    // 2. ì ‘ë¯¸ì‚¬(ë’·ê¸€ì) ê·¸ë£¹ í—¤ë” ì¶”ê°€
    finalRows.push([
      "ğŸŒ² ì ‘ë¯¸ì‚¬ ê¸°ì¤€ ê·¸ë£¹ (ë’·ê¸€ììˆœ)", 
      ""
    ]);

    // ì ‘ë¯¸ì‚¬ ê¸°ì¤€ ê·¸ë£¹ ì¶”ê°€
    optimalSuffixSubstrings.forEach(group => {
      finalRows.push([
        `ğŸ“Œ ë’·ë¶€ë¶„: ${group.substring} (${group.count})`, 
        ""
      ]);

      // ì´ ê·¸ë£¹ì— ì†í•œ ëª¨ë“  í† í° ì¶”ê°€
      const groupTokens = group.tokens.sort((a, b) => {
        // ê´„í˜¸ ì½˜í…ì¸  ë¨¼ì €, ê·¸ ë‹¤ìŒ ì•ŒíŒŒë²³ ìˆœ
        const aIsBracket = a.startsWith('[ê´„í˜¸]');
        const bIsBracket = b.startsWith('[ê´„í˜¸]');

        if (aIsBracket && !bIsBracket) return -1;
        if (!aIsBracket && bIsBracket) return 1;

        // ë’·ê¸€ì ê¸°ì¤€ ì •ë ¬
        return reverseString(a.replace('[ê´„í˜¸] ', '')).localeCompare(reverseString(b.replace('[ê´„í˜¸] ', '')));
      });

      groupTokens.forEach(token => {
        finalRows.push(["â””â”€", token]);
      });

      // ê·¸ë£¹ ê°„ êµ¬ë¶„ì„ ìœ„í•œ ë¹ˆ í–‰
      finalRows.push(["", ""]);
    });

    // 3. ë³µí•©ì–´ ê´€ê³„ ê·¸ë£¹ ì¶”ê°€
    if (compoundGroups.length > 0) {
      finalRows.push([
        "ğŸŒ² ë³µí•©ì–´ ê´€ê³„ ê·¸ë£¹", 
        ""
      ]);

      compoundGroups.forEach(group => {
        finalRows.push([
          `ğŸ“Œ ë³µí•©ì–´: ${group.parent.replace('[ê´„í˜¸] ', '')} (${group.children.length})`, 
          group.parent
        ]);

        // ìì‹ í† í° ì¶”ê°€
        group.children.forEach((child, idx) => {
          const position = group.positions[idx];
          const parentClean = group.parent.replace('[ê´„í˜¸] ', '');
          const childClean = child.replace('[ê´„í˜¸] ', '');

          // ìœ„ì¹˜ í‘œì‹œ ë¬¸ìì—´ ìƒì„±
          let positionMarker = '';
          if (position === 0) {
            positionMarker = 'â¬…ï¸ ì‹œì‘ ë¶€ë¶„';
          } else if (position + childClean.length === parentClean.length) {
            positionMarker = 'â¡ï¸ ë ë¶€ë¶„';
          } else {
            positionMarker = 'â¬‡ï¸ ì¤‘ê°„ ë¶€ë¶„';
          }

          finalRows.push([`â””â”€ [${positionMarker}]`, child]);
        });

        // ê·¸ë£¹ ê°„ êµ¬ë¶„ì„ ìœ„í•œ ë¹ˆ í–‰
        finalRows.push(["", ""]);
      });
    }

    // 4. ê·¸ë£¹ì— ì†í•˜ì§€ ì•Šì€ í† í° ì²˜ë¦¬
    const allGroupedTokens = new Set();

    // ëª¨ë“  ê·¸ë£¹ì˜ í† í° ìˆ˜ì§‘
    optimalPrefixSubstrings.forEach(group => 
      group.tokens.forEach(token => allGroupedTokens.add(token)));

    optimalSuffixSubstrings.forEach(group => 
      group.tokens.forEach(token => allGroupedTokens.add(token)));

    compoundGroups.forEach(group => {
      allGroupedTokens.add(group.parent);
      group.children.forEach(child => allGroupedTokens.add(child));
    });

    // ê·¸ë£¹ì— ì†í•˜ì§€ ì•Šì€ í† í° ì°¾ê¸°
    const ungroupedTokens = allMinTokens
      .filter(token => !allGroupedTokens.has(token))
      .sort();

    if (ungroupedTokens.length > 0) {
      finalRows.push(["ğŸŒ² ë¯¸ë¶„ë¥˜ í† í°", ""]);
      ungroupedTokens.forEach(token => {
        finalRows.push(["â””â”€", token]);
      });
    }

    // í…Œì´ë¸” ë°ì´í„° ì—…ë°ì´íŠ¸
    setTableData({
      headers: ["Group", "Token"],
      rows: finalRows
    });
  };

  // ì›ë³¸ ë°ì´í„°ë¡œ ë³µì›í•˜ëŠ” í•¨ìˆ˜
  const resetToOriginal = () => {
    if (originalTableData) {
      setTableData({...originalTableData});
    }
  };

  const renderTable = () => {
    if (!tableData.headers.length) return null;

    // íŠ¸ë¦¬ ì‹œê°í™”ë¥¼ ìœ„í•œ ë³€ìˆ˜
    let currentTreeType = "";

    return (
      <div className="data-table-container">
        <h4>{selectedFile?.name} - Data View</h4>
        <table className="data-table">
