              ))}
            </tr>
          </thead>
          <tbody>
            {tableData.rows.map((row, rowIdx) => {
              // ì£¼ìš” ê·¸ë£¹ íƒ€ì… ì‹ë³„
              const isTreeType = String(row[0]).startsWith('ğŸŒ²');
              const isGroupHeader = String(row[0]).startsWith('ğŸ“Œ');
              const isGroupItem = String(row[0]).startsWith('â””â”€');

              // í˜„ì¬ íŠ¸ë¦¬ íƒ€ì… ì—…ë°ì´íŠ¸
              if (isTreeType) {
                currentTreeType = String(row[0]);
              }

              // íŠ¸ë¦¬ íƒ€ì…ì— ë”°ë¥¸ í´ë˜ìŠ¤
              let treeTypeClass = '';
              if (currentTreeType.includes('ì ‘ë‘ì‚¬')) {
                treeTypeClass = 'prefix-tree';
              } else if (currentTreeType.includes('ì ‘ë¯¸ì‚¬')) {
                treeTypeClass = 'suffix-tree';
              } else if (currentTreeType.includes('ë³µí•©ì–´')) {
                treeTypeClass = 'compound-tree';
              } else if (currentTreeType.includes('ë¯¸ë¶„ë¥˜')) {
                treeTypeClass = 'ungrouped-tree';
              }

              return (
                <tr 
                  key={rowIdx} 
                  className={`
                    ${isTreeType ? 'tree-type' : ''} 
                    ${isGroupHeader ? 'group-header' : ''} 
                    ${isGroupItem ? 'group-item' : ''}
                    ${treeTypeClass}
                  `}
                >
                  {row.map((cell, cellIdx) => {
                    // ê´„í˜¸ ë‚´ìš© ì—¬ë¶€ í™•ì¸
                    const isBracketContent = String(cell).startsWith('[ê´„í˜¸]');
                    let displayContent = cell;

                    // ê´„í˜¸ ë‚´ìš©ì¸ ê²½ìš° íŠ¹ë³„ ì²˜ë¦¬
                    if (isBracketContent) {
                      displayContent = (
                        <>
                          <span className="bracket-indicator">âŠ‚âŠƒ</span>
                          {String(cell).replace('[ê´„í˜¸] ', '')}
                        </>
                      );
                    }

                    // ë©”ì¸ íŠ¸ë¦¬ íƒ€ì…ì¸ ê²½ìš° íŠ¹ë³„ ìŠ¤íƒ€ì¼ë§
                    if (isTreeType && cellIdx === 0) {
                      return (
                        <td 
                          key={cellIdx}
                          colSpan="2" 
                          className="tree-type-header"
                        >
                          {displayContent}
                        </td>
                      );
                    }

                    // ë³µí•©ì–´ ê·¸ë£¹ì˜ ìì‹ í† í°ì¸ ê²½ìš° ìœ„ì¹˜ í‘œì‹œ ì²˜ë¦¬
                    const isPositionIndicator = String(cell).includes('â¬…ï¸') || 
                                               String(cell).includes('â¡ï¸') || 
                                               String(cell).includes('â¬‡ï¸');

                    return (
                      <td 
                        key={cellIdx} 
